  [],\n\t\"num_tags\": 0,\n\t\"name\": \"2006-em300-and-em3002d-multibeam-sonar-data-from-cruise-hiialakai-hi-06-09-northwestern-hawaii\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"EM300 and EM3002D multibeam data were collected
  from 23 June to 20 July 2006 aboard NOAA Ship Hi'ialakai at Kure Atoll, Pearl and
  Hermes Atoll, Midway Island, and Kaua'i Island in the Central Pacific during cruise
  HI-06-09. These multibeam data were collected using SAIC ISS-2000 software in the
  Generic Sensor Format and processed using SABER editing software. Surface sound
  velocity values were supplied by a Seabird SBE-45 MicroTSG and a SBE-38 remote temperature
  probe. Sound velocity corrections from a Seabird 911 CTD sensor and motion corrections
  from a POS-MV vertical reference were applied to the data in real time. Predicted
  tides were applied to the data in real time using tide zoning and predicted tides
  supplied by NOAA's National Ocean Service Center for Operational Oceanographic Products
  and Services (CO-OPS). At Kure Atoll, Sand Island (1619910) predicted tides were
  used in zone HI48. At Pearl and Hermes Atoll, Sand Island (1619910) predicted tides
  were used for zones HI46 and HI47. At Midway island, Sand Island (1619910) predicted
  tides were used for tide zone HI47. At Kauai Island, Nawiliwili (1611400) predicted
  tides were used for tide zones HI137, HI139, HI152, HI153, HI154, and HI155. Horizontal
  accuracy is 20m (no differential GPS correctors applied), vertical accuracy is depth
  dependent (~1% of water depth), WGS84 datum. These data are not to be used for navigation.
  Depths mapped range from 2 to 3050 m. Concurrent mapping was done by the R/V AHI
  in water depths ranging from ~2-300 m with the data set being AHI-06-09; metadata
  for AHI-06-09 are submitted separately.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
